import React, { Component } from "react";
import MuiThemeProvider from "material-ui/styles/MuiThemeProvider";
import { List, ListItem } from "material-ui/List";
import Grid from '@material-ui/core/Grid';
import FormControl from '@material-ui/core/FormControl';

export class FormUserDetails extends Component {
    continue = e => {
        e.preventDefault();
        //Process form
        this.props.nextStep();
    };

    back = e => {
        e.preventDefault();
        this.props.prevStep();
    };

    render() {
        const {
            values: { firstName, lastName, email, team, city }
        } = this.props;
        return (
            <MuiThemeProvider>
                <React.Fragment>
                    <div className="bm-padding">
                        <form>
                            <div className="bm-center-content row">
                                <div className="container col">
                                    <h1>Confirm</h1>
                                    <FormControl>
                                        <ListItem primaryText="First Name" secondaryText={firstName} />
                                        <ListItem primaryText="Last Name" secondaryText={lastName} />
                                        <ListItem primaryText="Email" secondaryText={email} />
                                        <ListItem primaryText="Team" secondaryText={team} />
                                        <ListItem primaryText="City" secondaryText={city} />
                                    </FormControl>

                                    <br />


                                    <Grid className="list-inline">
                                        <button type="submit" variant="extendedFab" className="btn-success" onClick={this.continue} primary={true}>
                                            continue
								</button>

                                        <button type="submit" variant="extendedFab" className="btn-success" onClick={this.back} primary={false}>
                                            back
								</button>
                                    </Grid>
                                </div>
                            </div>
                        </form>
                    </div>
                </React.Fragment>
            </MuiThemeProvider>
        );
    }
}



export default FormUserDetails;
